 *
 * This contract is only required for intermediate, library-like contracts.
 */
abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        this; // silence state mutability warning without generating bytecode - see https://github.com/ethereum/solidity/issues/2691
        return msg.data;
    }
}



abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor () {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view virtual returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}




/*
* Locking Pancakeswap token until release_time (expressed in Unix epoch time)
* See https://www.unixtimestamp.com/ for conversion
* + wallet migration possibilities (without locking removal)
*/

contract LP_lock is Ownable {

    address wallet;
    IPancakePair public LP_token_contract;
    uint256 public release_time;

    event withdrawed (address to, uint256 bal);

    constructor (address _wallet, IPancakePair _LP_token_contract, uint256 _release_time) {
        require(_LP_token_contract.totalSupply() != 0, "Provide valid non-0 LP token contract"); //provide sanity test for degens
        wallet = _wallet;
        LP_token_contract = _LP_token_contract;
        release_time = _release_time;
    }

    /*
    * unlock, or try to. Will revert if too soon (that's what she said)
    */
    function gimme_my_liquidity () public onlyOwner {
        require(release_time <= block.timestamp, "LP still locked");
        uint256 balance = LP_token_contract.balanceOf(address(this));
        LP_token_contract.transfer(wallet, balance);
        emit withdrawed(wallet, balance);
    }

    function migrate_wallet (address new_wallet) public onlyOwner {
        wallet = new_wallet;
    }

    function get_balance() public view returns (uint256) {
        return LP_token_contract.balanceOf(address(this));
    }

}
